<p>双叶诚闻言马上就想到了女友要怎么表达了，他也想赶紧去安抚一下硬邦邦的肉棒，因为好像扯到阴毛了，不调整一下可太难受了啊！</p><p>于是顺口答应下来：“好的，那羽幽你要好好接受刚本大叔的歉意哦！</p><p>“唔呜……要快点回来……</p><p>“放心吧，我很快回来。”双叶诚说完又对刚本大叔说道：“那刚本大叔我先去给羽幽买瓶水，麻烦你跟她在这里等我一下哈！</p><p>“诶，要不还是我去吧，毕竟诚你才是宫白小姐的男朋友……</p><p>刚本大叔话还没说完，就见双叶诚已经飞快地拐了个弯奔着便利店跑去了，他也只能收回还未说出的话，充满活力的脸上则是露出一幅不太符合他一直以来人设的淫笑，抬起双手从皮卡丘玩偶两侧的隐蔽口子里钻了进去，再次握住两团丰满，雪嫩的乳肉，淫笑道：“宫白小姐这样可不行哦，在诚这个男朋友旁边和别人淫乱，看着诚长大的大叔我啊，可原谅不了这么淫荡的女孩子哦！</p><p>“……</p><p>宫白羽幽经过这一会的休息，身体和精神都恢复了不少，面对刚本大叔的调戏，她也没有说话，只是那只没塞在皮卡丘玩偶手臂里的粉嫩小手举到头套的嘴边，从里面拉开玩偶嘴上的拉链，让自己秀气精致的下巴和淡粉色的樱唇露了出来</p><p>“啧啧……</p><p>刚本大叔双眼闪烁着淫邪的光芒，毫不客气地把脸凑了上去，贴在皮卡丘头套上，透过拉开的拉链处吻住了宫白羽幽的小嘴，伸出淫舌舔了一下少女的樱唇，便直接钻进充满少女馨香的小嘴里，搅动着粉嫩的丁香小舌</p><p>“吧唧……吸溜……</p><p>顿时，一阵淫靡的口舌相交声不断响起，这下高桥哲也倒是有些妒忌刚本大叔能品尝宫白羽幽的小嘴了，不过想到自己的肉棒还插在宫白羽幽温暖紧凑的菊穴里，被她不断蠕动的娇嫩肠道夹住，高桥哲也也就不那么羡慕刚本大叔了</p><p>不过嘛，他也不能干等着让自己最喜欢的本子画家羽月老师和别人接吻吧</p><p>于是高桥哲也继续一边用手挑逗着宫白羽幽的白虎小嫩穴，一边耸动着屁股让肉棒在少女娇嫩的菊穴里抽插，淫荡的菊穴简直就是天生给大肉棒插的，跟小穴一样会分泌淫滑的液体，让大肉棒抽插起来舒畅</p><p>另一边，飞快跑到便利店买了瓶绿茶的双叶诚已经回到了拐弯处，偷偷探头看着旁若无人地站在道路上和刚本大叔接吻的宫白羽幽，或许是因为自己现在走开了，绑在皮卡丘玩偶里的高桥哲也动作很大，从侧面看可以清楚地看见宽大的玩偶背后的部位不断地起伏，尤其是屁股那一块！</p><p>透过眼镜，双叶诚可以清楚地看见女友白嫩的翘臀被死党的腹部不断撞击而升起一抹抹红晕，粗大的肉棒搅的菊穴口的嫩肉翻来覆去，就连白虎小穴，也被死党的色手用四根手指捂着揉搓，泛滥成灾的淫水不停地从死党的手指缝里流淌而出，看的刚调整好裤裆的双叶诚都忍不住把手从裤袋里伸进去，隔着两层布料摩擦着自己坚挺的肉棒了</p><p>宫白羽幽的小嘴被刚本大叔的嘴堵住，在看不见的玩偶嘴巴里，一大一小的两张嘴紧密相连地贴合着，不时还有淫靡的唾液从女友的嘴角处流出，两团丰满的玉乳被刚本大叔的双手肆意揉搓成各种各样的形状，娇嫩的肌肤哪里能承受的起这种力道，被揉搓的通红的同时，还留下了几根手指的印子，幸好这幅淫乱的模样藏在了皮套里，不然刚本大叔怕是会忍不住和高桥哲也来一次双龙戏凤的把戏吧？</p><p>双叶诚呼吸急促地套弄着自己的肉棒，他的视线在女友那被两个男人把玩的身子各处游荡，女友此刻的表情也很是可爱，半眯着弥漫着春雾的美眸，明明是三无少女的属性，却在男友以外的男人身边露出这么痴女的表情，可真是犯规啊！</p><p>就这么看了没一会，双叶诚便看见抽插着女友菊穴的高桥哲也狠狠抽送了几下肉棒后，便浑身一阵剧颤，令被刚本大叔死死吻住小嘴的宫白羽幽美眸突然睁大，唔唔两声后雪白的娇躯也颤抖了起来，显然是在高桥哲也中出她的菊穴时，也再一次迎来了高潮</p><p>“呃啊啊啊……羽幽……我的女友在大街上被一个大叔一边舌吻……一边被我的死党操屁穴中出高潮了啊啊！</p><p>双叶诚低吼一声，从放学忍耐到现在，硬了大半个小时的肉棒也终于在女友双穴都被死党中出后达到了极限，肉棒一颤一颤地抽搐着从马眼里射出几股有些透明的精液，这当然不是他的精液不行，而是天天看着女友像个公交车一样被人随便上，让他这个绿帽癖怎么能忍得住不撸上几次呢</p><p>在双叶诚射精完毕用提前准备好的纸巾清理裤裆时，那边的高桥哲也也收拾好了一下自己的仪容，从皮卡丘玩偶里钻了出来，看着已经跑的没影的刚本大叔，嘴里小声地嘀咕了一句，左右张望一下后拿下玩偶的头套，在满脸潮红露出阿黑颜似的表情的宫白羽幽脸上亲了一口，又把头套重新给少女戴上，便也离开了现场</p><p>宫白羽幽的娇躯早已经酥软无力，在失去外力的支撑下，刚泄了身子的她也双腿一软跪倒在地上，她那刚被中出过的菊穴像吐泡泡似的吐出几个淫靡的精液泡泡